{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/marcshervinignacio/modelling-track-popularity?scriptVersionId=112057151\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"9c26ce11","metadata":{"papermill":{"duration":0.006926,"end_time":"2022-11-25T14:43:13.748261","exception":false,"start_time":"2022-11-25T14:43:13.741335","status":"completed"},"tags":[]},"source":["## What song should we produce?\n","### 📖 Background \n","\n","You are working as an intern for a mega popstart that is looking to create and produce new music. Their team has hired you to investigate whether what should be the things they should consider in creating new music. Please note that the context of this study is based in the Philippines.\n","\n","Due to your initiative, you have stumbled upon Spotify's large database of songs and their audio features. You have thought about it and you will approach this problem using data and producing statistics. For this, you will be dealing how to predict song popularity using 11 different features.\n"]},{"cell_type":"markdown","id":"72dd7b4b","metadata":{"papermill":{"duration":0.005116,"end_time":"2022-11-25T14:43:13.758515","exception":false,"start_time":"2022-11-25T14:43:13.753399","status":"completed"},"tags":[]},"source":["### 💾 The data\n","\n","You have access to the following data (source): Taken from Spotify API 12 Nov 2022\n","\n","Song features:\n","\n","* 'track.popularity' - The popularity of the track. The value will be between 0 and 100, with 100 being the most popular.The popularity of a track is a value between 0 and 100, with 100 being the most popular. The popularity is calculated by algorithm and is based, in the most part, on the total number of plays the track has had and how recent those plays are. Generally speaking, songs that are being played a lot now will have a higher popularity than songs that were played a lot in the past. Duplicate tracks (e.g. the same track from a single and an album) are rated independently. Artist and album popularity is derived mathematically from track popularity,\n","\n","* 'danceability'- Danceability describes how suitable a track is for dancing based on a combination of musical elements including tempo, rhythm stability, beat strength, and overall regularity. A value of 0.0 is least danceable and 1.0 is most danceable.\n","\n","* 'energy' - Energy is a measure from 0.0 to 1.0 and represents a perceptual measure of intensity and activity. Typically, energetic tracks feel fast, loud, and noisy. For example, death metal has high energy, while a Bach prelude scores low on the scale. Perceptual features contributing to this attribute include dynamic range, perceived loudness, timbre, onset rate, and general entropy.\n","\n","* 'key'- The key the track is in. Integers map to pitches using standard Pitch Class notation. E.g. 0 = C, 1 = C♯/D♭, 2 = D, and so on. If no key was detected, the value is -1.\n","\n","* 'loudness' - The overall loudness of a track in decibels (dB). Loudness values are averaged across the entire track and are useful for comparing relative loudness of tracks. Loudness is the quality of a sound that is the primary psychological correlate of physical strength (amplitude). Values typically range between -60 and 0 db.\n","\n","* 'mode' - Mode indicates the modality (major or minor) of a track, the type of scale from which its melodic content is derived. Major is represented by 1 and minor is 0.\n","\n","* 'speechiness' - Speechiness detects the presence of spoken words in a track. The more exclusively speech-like the recording (e.g. talk show, audio book, poetry), the closer to 1.0 the attribute value. Values above 0.66 describe tracks that are probably made entirely of spoken words. Values between 0.33 and 0.66 describe tracks that may contain both music and speech, either in sections or layered, including such cases as rap music. Values below 0.33 most likely represent music and other non-speech-like tracks.\n","\n","* 'acousticness'\n","* 'instrumentalness' - Predicts whether a track contains no vocals. \"Ooh\" and \"aah\" sounds are treated as instrumental in this context. Rap or spoken word tracks are clearly \"vocal\". The closer the instrumentalness value is to 1.0, the greater likelihood the track contains no vocal content. Values above 0.5 are intended to represent instrumental tracks, but confidence is higher as the value approaches 1.0.\n","\n","* 'liveness' - Detects the presence of an audience in the recording. Higher liveness values represent an increased probability that the track was performed live. A value above 0.8 provides strong likelihood that the track is live.\n","\n","* 'valence' - A measure from 0.0 to 1.0 describing the musical positiveness conveyed by a track. Tracks with high valence sound more positive (e.g. happy, cheerful, euphoric), while tracks with low valence sound more negative (e.g. sad, depressed, angry).\n","\n","\n","* 'tempo' - The overall estimated tempo of a track in beats per minute (BPM). In musical terminology, tempo is the speed or pace of a given piece and derives directly from the average beat duration.\n","\n","* 'duration_ms' - The duration of the track in milliseconds.\n"]},{"cell_type":"markdown","id":"54667afd","metadata":{"papermill":{"duration":0.004922,"end_time":"2022-11-25T14:43:13.768568","exception":false,"start_time":"2022-11-25T14:43:13.763646","status":"completed"},"tags":[]},"source":["### This notebook's problems\n","\n","1. What are the common features of TOP 50 Philippines?\n","2. Which feature is correlated with higher track popularity score?\n","3. Model the track popularity using the given variables."]},{"cell_type":"markdown","id":"dfcf5fb0","metadata":{"papermill":{"duration":0.005139,"end_time":"2022-11-25T14:43:13.779008","excepti