","status":"completed"},"tags":[]},"source":["# Linear model of popularity"]},{"cell_type":"markdown","id":"80515ff3","metadata":{"papermill":{"duration":0.010282,"end_time":"2022-11-25T14:43:18.936651","exception":false,"start_time":"2022-11-25T14:43:18.926369","status":"completed"},"tags":[]},"source":["Our best model below regresses the square of popularity with acousticness, valence, and track duration. All these independent variables are significant predictors of track popularity. All of them have negative beta hats meaning the more 'acoustic', happy, and long a track is, the less popularity score it obtains. Our model is highly significant with an adjusted r-squared of 0.257, meaning that 25.7% of the variability of the square of track popularity can be explained by our independent variables.\n","\n","Thus, we may recommend to our 'boss' that we may look to produce a track that is the opposite of an acoustic and happy song, and keep it short."]},{"cell_type":"code","execution_count":8,"id":"7de94fc2","metadata":{"execution":{"iopub.execute_input":"2022-11-25T14:43:18.960058Z","iopub.status.busy":"2022-11-25T14:43:18.958508Z","iopub.status.idle":"2022-11-25T14:43:18.996903Z","shell.execute_reply":"2022-11-25T14:43:18.995254Z"},"papermill":{"duration":0.052596,"end_time":"2022-11-25T14:43:18.999181","exception":false,"start_time":"2022-11-25T14:43:18.946585","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n","Call:\n","lm(formula = popularity ~ ., data = filtered_audio_features)\n","\n","Residuals:\n","    Min      1Q  Median      3Q     Max \n","-26.830  -7.294   2.791   8.687  19.628 \n","\n","Coefficients:\n","                   Estimate Std. Error t value Pr(>|t|)    \n","(Intercept)       98.296678  21.673703   4.535 2.11e-05 ***\n","danceability       7.648372  12.439632   0.615  0.54050    \n","energy            14.277099  15.244372   0.937  0.35196    \n","key                0.177941   0.393520   0.452  0.65243    \n","loudness      